import { Component } from '@angular/core';
import { Router } from '@angular/router'; // Import Router

@Component({
  selector: 'app-naukri-first',
  templateUrl: './naukri-first.component.html',
  styleUrls: ['./naukri-first.component.css']
})
export class NaukriFirstComponent {

  constructor(private router: Router) {} // Inject Router

  // Navigate to Student Login
  goToStudentLogin() {
    this.router.navigate(['/student-login']);
  }

  // Navigate to Recruiter Login
  goToRecruiterLogin() {
    this.router.navigate(['/recruiter-login']);
  }
}
<p>Naukri-First Page works!</p>
<button class="btn-space" (click)="goToStudentLogin()">Student</button>
<button class="btn-space" (click)="goToRecruiterLogin()">Recruiter</button>
